using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.IO;

namespace PaiClass
{
    public class PaiCheat
    {
        public const string globals = "";
        public const string mainfunction = "";
        public const string endfunction = "63616C6C204578656375746546756E632822494C304F304F2229";

        public byte[] InsertCheat(byte[] war3mapj)
        {
            byte[] file = war3mapj;
            StringBuilder sb = new StringBuilder();
            string[] sep_mainfunc = { "66756E6374696F6E206D61696E2074616B6573206E6F7468696E672072657475726E73206E6F7468696E67" };
            string[] sep_endfunc = { "656E6466756E6374696F6E" };
            string[] result;
           
            foreach (byte b in file)
                sb.Append(b.ToString("X2"));

            if (sb.ToString().Contains("2F2F656E64676C6F62616C73"))
                sb.Replace("2F2F656E64676C6F62616C73", "2F2F656E642E676C6F62616C73");

            sb.Replace("656E64676C6F62616C73", globals);
            sb.Replace("66756E6374696F6E206D61696E2074616B6573206E6F7468696E672072657475726E73206E6F7468696E67", mainfunction);
            result = sb.ToString().Split(sep_mainfunc, StringSplitOptions.RemoveEmptyEntries);
            result = result[1].Split(sep_endfunc, StringSplitOptions.RemoveEmptyEntries);
            sb.Replace(result[0], result[0] + endfunction + "0D0A");

            return PaiCommon.HexStringToBytes(sb.ToString());
        }

        public byte[] InsertCheat(string filepath) => InsertCheat(File.ReadAllBytes(filepath));
    }
}
